import React, { Component } from "react";
import NavComplete from "../components/navcomplete";
import Data from "../data/allarticles.json";
import ArticleSpread from "../components/articlespread";

class AllArticles extends Component {
  state = {};
  render() {
    return (
      <div>
        <NavComplete />
        <div>
          <div style={{ position: "relative", marginTop: 50, left: 100 }}>
            <div
              style={{
                height: 20,
                width: 20,
                backgroundColor: "black",
                display: "flex",
                alignItems: "center",
              }}
            >
              <div
                style={{
                  fontSize: 30,
                  fontFamily: "Unna",
                  fontStyle: "italic",
                  fontWeight: "bold",
                  position: "relative",
                  left: "150%",
                }}
              >
                latest
              </div>
            </div>
          </div>
          <div
            style={{
              display: "grid",
              justifyContent: "center",
              gridTemplateColumns: "repeat(auto-fit, minmax(100px, 400px))",
              gridTemplateRows: "repeat(auto-fit, 400px)",
              gridGap: 50,
              marginTop: 50,
            }}
          >
            <React.Fragment>
              {Data.content.map((counter) => (
                <div>
                  <ArticleSpread
                    key={counter.id}
                    title={counter.title}
                    content={counter.summary}
                    link={counter.link}
                  />
                </div>
              ))}
            </React.Fragment>
          </div>
        </div>
      </div>
    );
  }
}

export default AllArticles;
